nav .indicator {
    position: fixed;
    left: 30px;
}

@media screen and (min-width: 880px) {
    nav .indicator {
        margin-left: calc(50% - 450px);
    }
}

.scroll > .scroll-top,
.scroll > .scroll-bottom {
    position: absolute;
    display: inline-block;
    width: 30px;
    border: none;
    height: 20px;
    padding: 5px;
    color: white;
    text-transform: capitalize;
    text-align: center;
    border-radius: 5px;
    background-color: #3b5998;
}

@media screen and (min-width: 880px) {
    .scroll-top,
    .scroll-bottom {
        margin-right: calc(50% - 450px);
    }
}

.scroll > .scroll-top {
    right: 120px;
    top: 30px;
    visibility: visible;
}

.scroll > .scroll-bottom {
    right: 80px;
    bottom: 300px;
    visibility: hidden;
}



nav.hidden {
    width: 200px;
    display: none;
}

.sidenav {
    height: 70%;
    width: 0;
    position: fixed;
    z-index: 1;
    top: 0;
    left: 0;
    background-color: rgba(17,17,17, 0.9);
    overflow-x: hidden;
    overflow-y: hidden;
    transition: 0.5s;
    padding-top: 60px;
}

@media screen and (min-width: 1300px) {
    .sidenav {
        left: calc(30% - 200px);
    }
}

@media screen and (max-width: 380px) {
    .sidenav {
        height: 80%;
    }
    .scroll > .scroll-top {
        right: 60px;
    }
    .scroll > .scroll-bottom {
        right: 20px;
        bottom: 350px;
    }
}

@media screen and (max-width: 330px) {
    .sidenav {
        height: 80%;
    }
    .scroll > .scroll-top {
        right: 60px;
    }
    .scroll > .scroll-bottom {
        right: 20px;
        bottom: 20px;
    }
}
.sidenav a {
    padding: 8px 8px 8px 32px;
    text-decoration: none;
    font-size: 25px;
    color: #818181;
    display: block;
    transition: 0.3s;
}

.sidenav a:hover {
    color: #f1f1f1;
}

.sidenav .closebtn {
    position: absolute;
    top: 0;
    right: 25px;
    font-size: 36px;
    margin-left: 50px;
}



